create table files
(
    id             int unsigned auto_increment comment '文件ID'
        primary key,
    file_path      varchar(128)                       not null comment '文件相对路径',
    file_url       text                               not null comment '文件 URL',
    `usage`        varchar(16)                        not null comment '文件用途',
    mime_type      varchar(32)                        not null comment '文件MIMEType',
    file_size      int unsigned                       not null comment '文件大小（byte）',
    file_name      varchar(64)                        not null comment '文件名',
    file_extension varchar(16)                        not null comment '文件后缀',
    uploader_id    int unsigned                       not null comment '上传者UserId',
    created_at     datetime default CURRENT_TIMESTAMP not null,
    updated_at     datetime                           null
)
    collate = utf8mb4_unicode_ci;

create index files_uploader_id_index
    on files (uploader_id);

